import React from 'react';
import StartButton from './components/StartButton';
import SelectionButton from './components/SelectionButton';
import Spinner from './components/Spinner';
import './styles/App.css';
//import Calendly from './components/Calendar';
// import Navbar from './components/Navbar';
import { useAuth0 } from "@auth0/auth0-react";
import { Layout } from 'antd';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
/*import Header from './components/Header';*/
import FileUploadPage from './components/uploadFile';
import Sider from './components/Sider';



const { Header, Content, Footer } = Layout;



function App() {

  const { isLoading, isAuthenticated } = useAuth0();


  if (isLoading) { return (<div className='container'><Spinner/></div>) };
  if (!isAuthenticated) { return (<div className='container'><StartButton/></div>) };


  return (
    <Router>
    <Layout>
        <Sider style={{background:'black'}} breakpoint="lg"
      collapsedWidth="0"
      onBreakpoint={broken => {
        console.log(broken);
      }}
      onCollapse={(collapsed, type) => {
        console.log(collapsed, type);
      }}>

      </Sider>
         <Layout>
            <Header style={{background:'black'}}>
            </Header>
            <Content className="container">
              <Switch>
                <Route path="/Schedule">
                  <FileUploadPage/>
                </Route>
                <Route path="/Dashboard">
                  Dashboard
                </Route>
                <Route path="/">
                  <SelectionButton name='Matching' path="/Dashboard"/>
                  <SelectionButton name='Scheduling' path="/Schedule"/>
                </Route>
              </Switch>
            </Content>
            <Footer style={{background:'#111111'}}></Footer>
          </Layout>
     </Layout>
     </Router>
  );
}

export default App;
